@McGramat Junior chodzi, do VI klasy. Kiedy był w starszakach byłem przekonany, że po nauczaniu początkowym dostaną po tablecie i do nauki.
Same plusy takiego rozwiązania.

Już nie wspominam o zysku w obecnej sytuacji ze zdalną edukacją. Nic w tym kraju dobrze nie działa ☹️

@tomaawroblewski Własna oczyszczalnia, studnia, ewentualnie fotowoltaika, terenówka, zdalna robota, etc
Hołownia chyba nie widział ostatnich podwyżek za komunalną kanalizację.
Zdecydowanie też wolę ciągnące się przedmieścia niż ludzi mieszkających w piętrowych kurnikach z widokiem na TV sąsiada.

@krzysztof_godek @DominikKucinsk 1. Nic lepszego od PiS NIE MAMY.
2. Ten rząd rozpoczął reformę szkolnictwa i ją sukcesywnie prowadzi.
3. Nauka zdalna, w dobie pandemii, była koniecznością - praktykowano ją na całym świecie. Gdyby Polacy byli bardziej subordynowani, szybciej by się uporano z zarazą.

@AlbinaMoscicka @magdakodds Jednak nie masz zbyt wiele praktycznego doświadczenia w tym temacie.
Praca nauczyciela eksploatuje człowieka psychicznie. Po wielu latach pracy w zawodzie nerwy bardzo przeszkadzają człowiekowi osiągać dobre wyniki. Dobitnie obnażyła to zdalna edukacja.

https://t.co/mSQA7NlWzl

Jako iż kończy się zdalna nauka chciałabym zrobić podsumowanie moich wszystkich profilowych;

(mam nadzieje ze o zadnym nie zapomniałam)
#powrotdoszkoly https://t.co/8VtPftopbf

@Protestuczniow1 @protest Foliarze chcą nas do szkół gonić, bo zamierzają nas bronią biologiczną zabić.
Jednak wiemy, że edukacja zdalna przyszłością świata jest. Na miejsce budynków szkolnych stwórzmy tereny zielone.
Nie bójmy się mówić tak nauce zdalnej, gdyż to ona lepiej uczy nas. 3x

@GburiaFuria @OsieckaNguyet Zapomniałam o jaśminie 🙈
Wyznanie : praca zdalna spowodowała, że nie przegapiłam wiosny. Już drugiej.
A poprzednie ledwo mignęły.

@MEIN_GOV_PL @CzarnekP @KurtykaMichal @MKiS_GOV_PL @marekgrobarczyk @MI_GOV_PL Zaoraliście nasze dzieci szkolne i potraktowaliście jak jakiś zbędny balast.
Od ponad roku desocjalizujecie i traumatyzujecie uczniów pseudonauką zdalną. Wielu jest przez to wykluczonych z edukacji.
W tej sytuacji wasze inicjatywy to smutny żart.

